	public static void runBenchmark(String json) {
		final int forks = 10;

		HashMap<Long, Integer> stats = new HashMap<Long, Integer>();

		for (int run = 0; run < forks; run++) {
			final int iterations = 3000;

			long lastTime = 0;
			for (int i = 0; i < iterations; i++) {
				//				JsonValue value = Json.parse(JSON_HUGE);

				long start = System.nanoTime();
				//				Json.parse(json); // 280
				//				new JsonSpeedParser(json).parse(); // 260
				//				new com.google.gson.JsonParser().parse(json); //260
				//				com.eclipsesource.json.Json.parse(json); // 210
				long time = (System.nanoTime() - start) / 1000; //MICROSECONDS
				if (i >= iterations - 2000 && i < iterations - 1000) {//JVM Should be warmed up		
					if (lastTime == time && time != 0) { //Only if two of the same in a row
						if (run > forks / 2) { //If the forks are more than halfway done
							stats.put(time, stats.containsKey(time) ? stats.get(time) + 1 : 1);
						}
					}
				}
				lastTime = time;
			}
		}

		long highest = 0;
		long value = 0;
		for (Entry<Long, Integer> entry : stats.entrySet()) {
			if (entry.getValue() > value) {
				value = entry.getValue();
				highest = entry.getKey();
			}
		}
		System.out.println();
		System.out.println("Stats: " + stats);

		System.out.println("Mode: " + highest + "s");

		long totalEntries = sum(stats.values());
		int weightedAverage = 0;
		for (Entry<Long, Integer> entry : stats.entrySet()) {
			//			System.out.println(entry.getKey() + " * " + (entry.getValue() / (double) totalEntries) + " = " + (entry.getKey() * (entry.getValue() / (double) totalEntries)));
			weightedAverage += entry.getKey() * (entry.getValue() / (double) totalEntries);
		}

		System.out.println("Weighted Average: " + weightedAverage + "s");
	}

	public static long getMode(long[] array) {
		int i = 0, j = 0;
		Arrays.sort(array);
		for (long x : array)
			i += x > array[j++ - i] ? 0 : 1;
		return i;
	}

	public static long sum(Collection<Integer> c) {
		long sum = 0;
		for (int i : c) {
			sum += i;
		}
		return sum;
	}

	public static String readFile(String filename) {
		try (BufferedReader br = new BufferedReader(new InputStreamReader(new FileInputStream(new File("resources" + File.separator + filename))))) {
			String content = "";
			String line = "";
			while ((line = br.readLine()) != null) {
				content += line;
			}
			return content;
		} catch (IOException e) {
			e.printStackTrace();
			return null;
		}
	}
